sections.css:
// Color
body{
	font-family:  Helvetica, Arial, sans-serfi;
}

.btn {
    padding: .5rem 1rem;
    display: inline-block;
    border: 1px solid #ccc;
    &--primary {
        background-color: red;
        color: #FFF;
        border: 1px solid red;
    }
    &--secondary {
        background-color: orange;
        color: #FFF;
        border: 1px solid orange;
    }
}


html {
    position: relative;
    min-height: 100%;
}

body {
    margin-bottom: 61px;
}

.footer {
    position: fixed;
    bottom: 0;
    width: 100%;
    height: 60px;
    background-color: #f5f5f5;
    p {
        font-size: 1.3rem;
    }
}

.container .text-muted {
    margin: 20px 0;
}

